import React, { useState } from 'react';
import "./css/addProd.css";
import Cookies from 'js-cookie';
import Axios from "axios";

function AddProd() {
    const [selectedImage, setSelectedImage] = useState(null);
    const sessionId = Cookies.get('session_UserID');
    const [nombre, setNombre] = useState("");
    const [precio, setPrecio] = useState("");
    const [cantidad, setCant] = useState("");
    const [desc, setDesc] = useState("");
    const [invent, setInvent] = useState("");

    const handleImageChange = (e) => {
        const file = e.target.files[0];
        if (file) {
            setSelectedImage(file);
        }
    };

    const add = () => {
        const formData = new FormData();
        formData.append('id', sessionId);
        formData.append('nombre', nombre);
        formData.append('precio', precio);
        formData.append('cantidad', cantidad);
        formData.append('desc', desc);
        formData.append('invent', invent);
        if (selectedImage) {
            formData.append('image', selectedImage);
        }

        Axios.post("http://localhost:3001/api/users/registerProduct", formData, {
            headers: {
                'Content-Type': 'multipart/form-data'
            }
        }).then(response => {
            if (response.data.id == 1) {
                // En caso de éxito
                console.log(response.data.id);
                alert(response.data.message);
                window.location.reload(); // Provisional, cambiar a history para uso completo de las funciones de react
            } else {
                console.log(response.data.id);
                alert(response.data.message);
            }
        }).catch(error => {
            alert("Error con la comunicación con el servidor");
        });
    }

    const clear = () => {
        window.location.reload();
    }

    return (
        <div className='producto'>
            <div className='contenedor-producto'>
                <h2>Añadir producto</h2>
                {selectedImage && (
                    <img src={URL.createObjectURL(selectedImage)} alt="Selected" style={{ maxWidth: '200px', maxHeight: '200px' }} />
                )}
                <div className='group-labels'>
                    <label htmlFor="img">Select image:</label>
                    <input type="file" id="img" name="img" accept="image/*" onChange={handleImageChange} />
                </div>

                <div className='group-labels'>
                    <label>Titulo del producto</label>
                    <input className="Elements" type="text" id="Nombre" onChange={(event) => { setNombre(event.target.value); }} />
                </div>
                <div className='group-labels'>
                    <label>Categoria</label>
                    <select className="option" name="Tipo">
                        <option value="Electronica">Electronica</option>
                        <option value="Ferreteria">Ferreteria</option>
                    </select>
                </div>

                <div className='group-labels'>
                    <label>Precio $</label>
                    <input className="Elements" type="text" id="Precio" onChange={(event) => { setPrecio(event.target.value); }} />
                </div>

                <div className='group-labels'>
                    <label>Cantidad</label>
                    <input className="Elements" type="text" id="Precio" onChange={(event) => { setCant(event.target.value); }} />
                </div>

                <div className='group-labels'>
                    <label>No. piezas</label>
                    <input className="Elements" type="text" id="Precio" onChange={(event) => { setInvent(event.target.value); }} />
                </div>

                <div className='group-labels'>
                    <label>Acerca de:</label>
                    <textarea name="postContent" rows={4} cols={40} onChange={(event) => { setDesc(event.target.value); }} />
                </div>
            </div>
            <div className='buttons-down'>
                <div className='botones'>
                    <button type="submit" onClick={clear}>Cancelar</button>
                    <button type="submit" onClick={add}>Guardar</button>
                </div>
            </div>
        </div>
    );
}

export default AddProd;
